import React from "react";
import styled from "styled-components";
import BenedictusAdriel from "../../images/BenedictusAdriel.webp";

const goalStyled = styled.div``;
const GoalSection = () => {
  return (
    <goalStyled>
      <div className="goal1">
        <div>
          <img src={BenedictusAdriel} alt="" />
        </div>
      </div>
    </goalStyled>
  );
};

export default GoalSection;
